import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<p>Hello</p>} />
        <Route path="/about" element={<p>About</p>} />
      </Routes>
    </Router>
  );
}

export default App;
